import sys
from datetime import datetime, date
from decimal import *

sys.path.append('/pipelines/helpers')
total = len(records)
def convert_to_decimal(value):
  if value == '' or value is None or value == 'null':
    return None
  return Decimal(value)

def created_times(record):
  now_time_pacific = datetime.now().strftime('%Y-%m-%d')
  record.value['created_at'] = now_time_pacific
  record.value['updated_at'] = now_time_pacific
  if '9' in record.value:
    record.value['longitude'] = convert_to_decimal(record.value['9'])
  if '8' in record.value:
    record.value['latitude'] = convert_to_decimal(record.value['8'])
  return record

for record in records:
  try:
    record = created_times(record)
    output.write(record)

  except Exception as e:
    error.write(record, str(e))
